import React, { useState } from 'react';
import logo from "../images/logo.jpg";
import "./navbar.css";
import { Routes, Route, Link } from "react-router-dom";
import Client from './Client';
import Login from './Login';
import PatientAppointmentForm from "./PatientAppointmentForm";
import DashBoard from "./DashBoard";
import Report from "./ReportG";
import Claim from "./Claim";
import Billing from './billing';
import AddClient from "./AddClient";
import Claimstatus from "./Claimstatus";
import Home from "../Home/Home";

const Navbar = () => {
  const [islogin, setlogin] = useState(false);

  return (
    <>
      {islogin ? (
        <>
          <div id='navbar'>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
              <div className="container-fluid">
                <Link className="navbar-brand" to="/home">
                  <img src={logo} alt="logo" id='logo' />
                </Link>
                <button
                  className="navbar-toggler"
                  type="button"
                  data-bs-toggle="collapse"
                  data-bs-target="#navbarSupportedContent"
                  aria-controls="navbarSupportedContent"
                  aria-expanded="false"
                  aria-label="Toggle navigation"
                >
                  <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                  <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                    <li className="nav-item">
                      <Link className="nav-link active" aria-current="page" to="/home">Home</Link>
                    </li>
                    <li className="nav-item">
                      <Link className="nav-link" to="/Appointment">Appointment</Link>
                    </li>
                    <li className="nav-item dropdown">
                      <Link className="nav-link dropdown-toggle" to="/" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Client
                      </Link>
                      <ul className="dropdown-menu">
                        <li><Link className="dropdown-item" to="/AddClient">Add Client</Link></li>
                        <li><Link className="dropdown-item" to="/client">Client List</Link></li>
                        <li><hr className="dropdown-divider" /></li>
                        <li><Link className="dropdown-item" to="/generate">Generate Report</Link></li>
                      </ul>
                    </li>
                    <li className="nav-item dropdown">
                      <Link className="nav-link dropdown-toggle" to="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Billing
                      </Link>
                      <ul className="dropdown-menu">
                        <li><Link className="dropdown-item" to="/bill">Billing Status</Link></li>
                      </ul>
                    </li>
                    <li className="nav-item dropdown">
                      <Link className="nav-link dropdown-toggle" to="/" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Insurance
                      </Link>
                      <ul className="dropdown-menu">
                        <li><Link className="dropdown-item" to="/claim">Add Claim</Link></li>
                        <li><Link className="dropdown-item" to="/Clients">Claim Status</Link></li>
                      </ul>
                    </li>
                    <li className="nav-item">
                      <Link className="nav-link" to="/Dashboard">Dashboard</Link>
                    </li>
                  </ul>
                  <button id='logoutbtn'>
                    <Link
                      className='text text-light'
                      id="logout"
                      to="/"
                      onClick={() => { setlogin(false); }}
                    >
                      Logout
                    </Link>
                  </button>
                </div>
              </div>
            </nav>
          </div>

          <div className='main_container'>
            <Routes>
              <Route path="/home" element={<Home />} />
              <Route path="/Client" element={<Client />} />
              <Route path="/generate" element={<Report />} />
              <Route path="/Appointment" element={<PatientAppointmentForm />} />
              <Route path="/claim" element={<Claim />} />
              <Route path="/bill" element={<Billing />} />
              <Route path="/AddClient" element={<AddClient />} />
              <Route path="/Clients" element={<Claimstatus />} />
              <Route path="/Dashboard" element={<DashBoard />} />
            </Routes>
          </div>
        </>
      ) : (
        <Login setlogin={setlogin} />
      )}
    </>
  );
};

export default Navbar;
